import React from "react";
import Timeline from "react-calendar-timeline";
import moment from "moment";

const groups = [
  { id: 1, title: "Ryan - Cloud System Engineer" },
  { id: 2, title: "Kate - Help Desk Specialist" },
  { id: 3, title: "John - Application Developer" },
  { id: 4, title: "Mark - Network Administrator" },
  { id: 5, title: "Sharon - Data Quality Manager" },
  { id: 6, title: "Emma - Product Testing Analyst" },
];

const items = [
  {
    id: 1,
    group: 5,
    title: "07:00 - 13:00",
    start_time: moment("2025-04-07T07:00:00"),
    end_time: moment("2025-04-07T13:00:00"),
    style: { backgroundColor: "#fce96a" },
  },
  {
    id: 2,
    group: 6,
    title: "07:00 - 13:00",
    start_time: moment("2025-04-07T07:00:00"),
    end_time: moment("2025-04-07T13:00:00"),
    style: { backgroundColor: "#a8e6cf" },
  },
  {
    id: 3,
    group: 2,
    title: "12:00 - 18:00",
    start_time: moment("2025-04-07T12:00:00"),
    end_time: moment("2025-04-07T18:00:00"),
    style: { backgroundColor: "#b2f2bb" },
  },
  {
    id: 4,
    group: 4,
    title: "12:00 - 18:00",
    start_time: moment("2025-04-07T12:00:00"),
    end_time: moment("2025-04-07T18:00:00"),
    style: { backgroundColor: "#f5b5fc" },
  },
  {
    id: 5,
    group: 1,
    title: "07:00 - 13:00",
    start_time: moment("2025-04-08T07:00:00"),
    end_time: moment("2025-04-08T13:00:00"),
    style: { backgroundColor: "#fabebe" },
  },
  {
    id: 6,
    group: 3,
    title: "12:00 - 18:00",
    start_time: moment("2025-04-09T12:00:00"),
    end_time: moment("2025-04-09T18:00:00"),
    style: { backgroundColor: "#add8e6" },
  },
  {
    id: 7,
    group: 2,
    title: "12:00 - 18:00",
    start_time: moment("2025-04-08T12:00:00"),
    end_time: moment("2025-04-08T18:00:00"),
    style: { backgroundColor: "#b2f2bb" },
  },
];

const ShiftTimeline = () => {
  const defaultTimeStart = moment("2025-04-06").startOf("day");
  const defaultTimeEnd = moment("2025-04-10").endOf("day");

  return (
    <div>
      <h2 className="text-xl font-bold mb-4">Shift Timeline</h2>
      <Timeline
        groups={groups}
        items={items}
        defaultTimeStart={defaultTimeStart}
        defaultTimeEnd={defaultTimeEnd}
        canMove={false}
        canResize={false}
        itemHeightRatio={0.75}
      />
    </div>
  );
};

export default ShiftTimeline;
